import React from 'react';
import {PricingTable, PricingSlot, PricingDetail} from 'react-pricing-table';
import {Elements} from '@stripe/react-stripe-js';
import {loadStripe} from '@stripe/stripe-js';
import StripeForm from './Stripe.js'

const stringPublishableKey = "pk_test_51IGxmWJJa9Cf8TPSBcMSZ1xdXYV59vkfVdLswE47L8en8q3HgWQ13LJjvsmnjOORhR9cfDAfqyh7iNTA7sa5aE9u004W4G88VC";
const stripePromise = loadStripe(stringPublishableKey);

export default class Pricing extends React.Component {

  constructor(props) {
    super(props);
    this.tooltipRef = React.createRef();
  }

  render() {
    const modal = {
        fontSize: '12px'
    };

    const modalContent = {
      width: '100%',
      padding: '20px',
      textAlign: 'center'
    }

    const modalActions = {
      width: '100%',
      padding: '10px 5px',
      margin: 'auto',
      textAlign: 'center'
    }

    const modalClose = {
      cursor: 'pointer',
      position: 'absolute',
      display: 'block',
      padding: '2px 5px',
      lineHeight: '20px',
      right: '-10px',
      top: '-10px',
      fontSize: '24px',
      background: '#ffffff',
      borderRadius: '18px',
      border: '1px solid #cfcece'
    }

    return (
      <Popup
        trigger={ <Button color="primary" size="sm"> Add User </Button>}
        modal
        nested
        style={{width:'50%'}}
      >
          {close => (
          <div style={modal}>
            <button className="close" onClick={close}>
               &times;
            </button>
            <div style={modalContent}  className="content">
            <Elements stripe={stripePromise}>
              <StripeForm />
            </Elements>
            </div>
          </div>
        )}
      </Popup>
    );
  }

}
